    #define CEU_ACC(v) ({               \
        CEU_Value ceu_old = ceu_acc;    \
        CEU_Value ceu_new = v;          \
        ceu_acc = (CEU_Value) { CEU_VALUE_NIL }; \
        ceu_gc_inc_val(ceu_new);        \
        ceu_gc_dec_val(ceu_old);        \
        ceu_acc = ceu_new;              \
        ceu_acc;                        \
    })
    #define CEU_ACC_KEEP() ({                       \
        CEU_Value ceu_tmp = ceu_acc;                \
        ceu_acc = (CEU_Value) { CEU_VALUE_NIL };    \
        ceu_tmp;                                    \
    })
    
